import "./navbar.css"
import {IsAuth} from "../../isAuth/isAuth";


export const NavBar = () => {
    if (IsAuth()) {
        return (
            <div className="navbar">
                <div className="logo">
                    <h2 className="logo">NNapp</h2>
                </div>
                <div className="links">
                    <a href="" className="link">GitHub</a>
                    <a href="" className="link">About</a>
                    <a href="" className="link">Logout</a>
                </div>
            </div>
        );
    }

}
